import React, { useState, useEffect } from 'react';
import axios from 'axios';

import MovieList from '../components/MovieList'; // Update the import statement with the correct path

const Home = () => {
  const [movies, setMovies] = useState([]);

  useEffect(() => {
    const fetchMovies = async () => {
      try {
        const response = await axios.get(
          'https://api.themoviedb.org/3/movie/550?api_key=0a2f607817c9b6e6df093289ee34c09a'
        );
        setMovies(response.data.results);
      } catch (error) {
        console.error('Error fetching movies:', error);
      }
    };

    fetchMovies();
  }, []);

  return (
    <div>
      {movies.length > 0 ? <MovieList movies={movies} /> : <p>Loading movies...</p>}
    </div>
  );
};

export default Home;
